function Invoke-StickyReader{

<# 

.SYNOPSIS

Author: @whitej3rry


.DESCRIPTION

    - This script reads the sticky notes using SQLite dlls
    - Currently only reads Sticky Notes from Windows 10


.EXAMPLE

PS> Invoke-StickyReader

.EXAMPLE

PS> Invoke-Expression(New-Object Net.WebClient).DownloadString("https://raw.githubusercontent.com/whitej3rry/StickyReader/master/Invoke-StickyReader.ps1")

#>
    #SQLite DLL 
    $SqliteDll = ""
    #SQLite Interop DLL
    $SqliteInteropDll = ""

    $DllBytes = [System.Convert]::FromBase64String($SqliteDll)
    [System.Reflection.Assembly]::Load($DllBytes)

    $InteropDllBytes = [System.Convert]::FromBase64String($SqliteInteropDll)
    [System.Reflection.Assembly]::Load($InteropDllBytes)

    Set-Content -Path $env:temp\SQLite.dll -Value $DllBytes -Encoding Byte
    Set-Content -Path $env:temp\SQLiteInterop.dll -Value $InteropDllBytes -Encoding Byte
   

    $ConnectionString = [Environment]::GetFolderPath('LocalApplicationData')+"\Packages\Microsoft.MicrosoftStickyNotes_8wekyb3d8bbwe\LocalState\plum.sqlite"
    write-host $connectionstring

    $conn = new-object -typename System.Data.SQLite.SQLiteConnection
    $conn.connectionstring = "Data Source=$ConnectionString"
    $conn.Open()
    


    $sql = $conn.CreateCommand()
    $sql.CommandText = "SELECT * FROM Note"
    $adapter = New-Object -TypeName System.Data.SQLite.SQLiteDataAdapter $sql
    $data = New-Object System.Data.DataSet
    [void]$adapter.Fill($data)

    $data.tables.rows | findstr "\id"





    Remove-Item $env:temp\SQLite.dll
    Remove-Item $env:temp\SQLiteInterop.dll
    
    

}


Invoke-StickyReader